import React from 'react';
import './styles.scss';
import sidebarItems from './sidebarItems';
// import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="sidebar-wrapper">
      <ul>
        {
          sidebarItems.map((item) => {
            return <Link>
              <img src={item.icon()} alt="icon" />
            </Link>;
          })
        }
      </ul >
    </div >
  );
};

export default Sidebar;
